import './App.css';
// import Header from './components/header';
import Header from './components/header';
import Footer from './components/footer';
import HelloWorld from './components/content';
import DATE from './components/content';
function App() {
  return (
    <div className="App">
      <Header />
      <HelloWorld />
      <DATE />
      <Footer />
    </div>
  );
}

export default App;
